26389 26399\n#spring.redis.sentinel.nodes=192.168.1.107:26380,192.168.1.107:26389,192.168.1.107:26399\n\nspring.redis.timeout=5000\nspring.redis.password=redis\nspring.redis.database=10\n# rocketmq \nspring.cloud.stream.rocketmq.binder.name-server=127.0.0.1:9876\n# rabbit mq的配置\n# spring.cloud.stream.binders.local_rabbit.type= rabbit\n# spring.cloud.stream.binders.local_rabbit.environment.spring.rabbitmq.host=192.168.1.107\n# spring.cloud.stream.binders.local_rabbit.environment.spring.rabbitmq.port=5672\n# spring.cloud.stream.binders.local_rabbit.environment.spring.rabbitmq.username=admin\n# spring.cloud.stream.binders.local_rabbit.environment.spring.rabbitmq.password=admin\n# spring.cloud.stream.binders.local_rabbit.environment.spring.rabbitmq.virtual-host= /\n\ndruid.account=admin\ndruid.password=admin\n\nspring.mail.port=25\nspring.mail.username=58133370@qq.com\nspring.mail.password=wnmvrdgaeickcbdc\nspring.mail.protocol=smtp\nspring.mail.default-encoding=utf-8\nspring.mail.host=smtp.qq.com\nspring.mail.properties.mail.smtp.auth=true\nspring.mail.properties.mail.smtp.starttls.enable=true\nspring.mail.properties.mail.smtp.starttls.required=true\n\n\n# 生成表前缀配置\nprefix.table=W_\nprefix.colpre=\n\n\n#应用编码\nredxun.app.clientId=webApp\n#应用密钥\nredxun.app.clientSecret=webApp\n#应用密钥(明文)\nredxun.app.clientSecretStr=\n#回调地址\nredxun.app.webServerRedirectUri=\n#令牌有效期\nredxun.app.accessTokenValidity=18000\n#令牌刷新有效期\nredxun.app.refreshTokenValidity=28800\n#资源限定串(逗号分割)\nredxun.app.resourceIds=\n#范围\nredxun.app.scope=all\n#授权方式\nredxun.app.authorizedGrantTypes=\n#权限\nredxun.app.authorities=\nredxun.app.additionalInformation={}\n#是否自动授权\nredxun.app.autoapprove=false\n\n# 定时任务调度中心地址\njob.center=http://localhost:7878/job\n\n# 日志输出\nspring.cloud.stream.bindings.logOutput.destination=log\nspring.cloud.stream.bindings.logOutput.group= logout-group\n\n# 日志输出模式 (db 记录到数据库,logger 保存到日志文件)\nredxun.audit-log.log-type=logger\n\n# 是否允许数据源监控\ndatasource.monitor=true\n\n# tomcat 调优 \n# 等待连接数\nserver.tomcat.accept-count=1000\n# 最大连接数\nserver.tomcat.max-connections=1000\n# 最大线程数量\nserver.tomcat.max-threads=1000\n# 最小线程数\nserver.tomcat.min-spare-threads=10\n\n# 缓存机制为内存。可配置的值为 memory,j2cache\nredxun.cache=j2cache\n\n\n#zipkin-server地址\nspring.zipkin.base-url=\nspring.zipkin.discoveryClientEnabled=false\n#接口采样比例 \nspring.sleuth.sampler.probability=1\n\n#是否开启url级别权限\nredxun.security.auth.urlPermission.enable=true\n\n# 是否允许开发实例隔离\nredxun.ribbon.isolation.enabled=true\n#同步初始化密码\nredxun.initpwd=1234\n#同步组织的方式  weixin (微信) dd(钉钉)\nredxun.syncorg=weixin\n#调整Spring Cloud Feign \nfeign.compression.request.min-request-size=5120\n# API日志输出队列\nspring.cloud.stream.bindings.apiLogOut.destination= apilog\nspring.cloud.stream.bindings.apiLogOut.group= apilog-group\n\nspring.cloud.stream.bindings.errLogOut.destination= errlog\nspring.cloud.stream.bindings.errLogOut.group= errlog-group\n# 单个文件大小\nspring.servlet.multipart.max-file-size= 200MB\n# 总的请求数大小\nspring.servlet.multipart.max-request-size= 200MB\n\n#定时器开关\njob.user=true\njob.bpm=true\njob.system=false\n\nlogging.level.org.redisson = error\nlogging.level.com.redxun = error\nlogging.level.com.netflix = error\nlogging.level.org.springframework = error\nlogging.level.com.alibaba = error\n', '586a6fc10d6d02baca2005dfd8360d7d', '2021-12-15 03:23:24', '2022-01-14 07:55:25', 'nacos', '0:0:0:0:0:0:0:1', '', 'redxun', '', '', '', 'properties', '', null);
