INSERT INTO `config_info` VALUES ('141', 'j2cache-dev.properties', 'DEFAULT_GROUP', '#J2Cache configuration\n\n#########################################\n# Cache Broadcast Method\n# values:\n# jgroups -> use jgroups\'s multicast\n# redis -> use redis publish/subscribe mechanism (using jedis)\n# lettuce -> use redis publish/subscribe mechanism (using lettuce, Recommend)\n# rabbitmq -> use RabbitMQ publisher/consumer mechanism\n# rocketmq -> use RocketMQ publisher/consumer mechanism\n# none -> don\'t notify the other nodes in cluster\n# xx.xxxx.xxxx.Xxxxx your own cache broadcast policy classname that implement net.oschina.j2cache.cluster.ClusterPolicy\n#########################################\n\nj2cache.broadcast = redis\n\n#########################################\n# Level 1&2 provider\n# values:\n# none -> disable this level cache\n# ehcache -> use ehcache2 as level 1 cache\n# ehcache3 -> use ehcache3 as level 1 cache\n# caffeine -> use caffeine as level 1 cache(only in memory)\n# redis -> use redis as level 2 cache (using jedis)\n# lettuce -> use redis as level 2 cache (using lettuce)\n# readonly-redis -> use redis as level 2 cache ,but never write data to it. if use this provider, you must uncomment `j2cache.L2.config_section` to make the redis configurations available.\n# memcached -> use memcached as level 2 cache (xmemcached),\n# [classname] -> use custom provider\n#########################################\n\nj2cache.L1.provider_class = caffeine\nj2cache.L2.provider_class = none\n\n# When L2 provider isn\'t `redis`, using `L2.config_section = redis` to read redis configurations\n# j2cache.L2.config_section = redis\n\n# Enable/Disable ttl in redis cache data (if disabled, the object in redis will never expire, default:true)\n# NOTICE: redis hash mode (redis.storage = hash) do not support this feature)\nj2cache.sync_ttl_to_redis = false\n\n# Whether to cache null objects by default (default false)\nj2cache.default_cache_null_object = true\n\n#########################################\n# Cache Serialization Provider\n# values:\n# fst -> using fast-serialization (recommend)\n# kryo -> using kryo serialization\n# json -> using fst\'s json serialization (testing)\n# fastjson -> using fastjson serialization (embed non-static class not support)\n# java -> java standard\n# fse -> using fse serialization\n# [classname implements Serializer]\n#########################################\n\nj2cache.serialization = fst\n#json.map.person = net.oschina.j2cache.demo.Person\n\n\n\n#########################################\n# Caffeine configuration\n# caffeine.region.[name] = size, xxxx[s|m|h|d]\n#\n#########################################\ncaffeine.region.default = 1000, 1h\ncaffeine.region.bpm = 1000, 1800s\ncaffeine.region.form = 10000, 1h\ncaffeine.region.bo = 1000, 1h\ncaffeine.region.boList = 1000, 1h\ncaffeine.region.api = 100000, 365d\ncaffeine.region.signature = 1000, 120s\n\n\n\n#########################################\n# Lettuce scheme\n#\n# redis -> single redis server\n# rediss -> single redis server with ssl\n# redis-sentinel -> redis sentinel\n# redis-cluster -> cluster servers\n#\n#########################################\n\n#lettuce.namespace =\n#lettuce.storage = generic\n#lettuce.channel = j2cache\n#lettuce.scheme = redis\n#lettuce.hosts = 192.168.31.10:6379\n#lettuce.password =\n#lettuce.database = 0\n#lettuce.sentinelMasterId =\n#lettuce.maxTotal = 100\n#lettuce.maxIdle = 10\n#lettuce.minIdle = 10\n## timeout in milliseconds\n#lettuce.timeout = 10000\n\n\n\n\n#########################################\n# Redis Cluster Mode\n#\n# single -> single redis server\n# sentinel -> master-slaves servers\n# cluster -> cluster servers (\\u6570\\u636E\\u5E93\\u914D\\u7F6E\\u65E0\\u6548\\uFF0C\\u4F7F\\u7528 database = 0\\uFF09\n# sharded -> sharded servers  (\\u5BC6\\u7801\\u3001\\u6570\\u636E\\u5E93\\u5FC5\\u987B\\u5728 hosts \\u4E2D\\u6307\\u5B9A\\uFF0C\\u4E14\\u8FDE\\u63A5\\u6C60\\u914D\\u7F6E\\u65E0\\u6548 ; redis://user:password@127.0.0.1:6379/0\\uFF09\n#\n#########################################\n\nredis.mode = single\n\n#redis storage mode (generic|hash)\nredis.storage = generic\n\n## redis pub/sub channel name\nredis.channel = j2cache\n## redis pub/sub server (using redis.hosts when empty)\nredis.channel.host =\n\n#cluster name just for sharded\nredis.cluster_name = j2cache\n\n## redis cache namespace optional, default[empty]\nredis.namespace =\n\n## connection\n# Separate multiple redis nodes with commas, such as 192.16\n#\n# 8.0.10:6379,192.168.0.11:6379,192.168.0.12:6379\n\nredis.hosts = 172.30.0.4:6379\nredis.timeout = 2000\nredis.password = redxun\nredis.database = 0\nredis.ssl = false\n\n## redis pool properties\nredis.maxTotal = 100\nredis.maxIdle = 10\nredis.maxWaitMillis = 5000\nredis.minEvictableIdleTimeMillis = 60000\nredis.minIdle = 1\nredis.numTestsPerEvictionRun = 10\nredis.lifo = false\nredis.softMinEvictableIdleTimeMillis = 10\nredis.testOnBorrow = true\nredis.testOnReturn = false\nredis.testWhileIdle = true\nredis.timeBetweenEvictionRunsMillis = 300000\nredis.blockWhenExhausted = false\nredis.jmxEnabled = false\n\n', '4e026ecd1851619228c1226aea2930f2', '2022-01-20 05:53:03', '2022-04-08 16:00:38', 'nacos', '192.168.1.208', '', 'local', '', '', '', 'properties', '', '');
INSERT INTO `config_info` VALUES ('142', 'j2cache-prod.properties', 'DEFAULT_GROUP', '#J2Cache configuration\n\n#########################################\n# Cache Broadcast Method\n# values:\n# jgroups -> use jgroups\'s multicast\n# redis -> use redis publish/subscribe mechanism (using jedis)\n# lettuce -> use redis publish/subscribe mechanism (using lettuce, Recommend)\n# rabbitmq -> use RabbitMQ publisher/consumer mechanism\n# rocketmq -> use RocketMQ publisher/consumer mechanism\n# none -> don\'t notify the other nodes in cluster\n# xx.xxxx.xxxx.Xxxxx your own cache broadcast policy classname that implement net.oschina.j2cache.cluster.ClusterPolicy\n#########################################\n\nj2cache.broadcast = redis\n\n#########################################\n# Level 1&2 provider\n# values:\n# none -> disable this level cache\n# ehcache -> use ehcache2 as level 1 cache\n# ehcache3 -> use ehcache3 as level 1 cache\n# caffeine -> use caffeine as level 1 cache(only in memory)\n# redis -> use redis as level 2 cache (using jedis)\n# lettuce -> use redis as level 2 cache (using lettuce)\n# readonly-redis -> use redis as level 2 cache ,but never write data to it. if use this provider, you must uncomment `j2cache.L2.config_section` to make the redis configurations available.\n# memcached -> use memcached as level 2 cache (xmemcached),\n# [classname] -> use custom provider\n#########################################\n\nj2cache.L1.provider_class = caffeine\nj2cache.L2.provider_class = none\n\n# When L2 provider isn\'t `redis`, using `L2.config_section = redis` to read redis configurations\n# j2cache.L2.config_section = redis\n\n# Enable/Disable ttl in redis cache data (if disabled, the object in redis will never expire, default:true)\n# NOTICE: redis hash mode (redis.storage = hash) do not support this feature)\nj2cache.sync_ttl_to_redis = true\n\n# Whether to cache null objects by default (default false)\nj2cache.default_cache_null_object = true\n\n#########################################\n# Cache Serialization Provider\n# values:\n# fst -> using fast-serialization (recommend)\n# kryo -> using kryo serialization\n# json -> using fst\'s json serialization (testing)\n# fastjson -> using fastjson serialization (embed non-static class not support)\n# java -> java standard\n# fse -> using fse serialization\n# [classname implements Serializer]\n#########################################\n\nj2cache.serialization = fst\n#json.map.person = net.oschina.j2cache.demo.Person\n\n\n\n#########################################\n# Caffeine configuration\n# caffeine.region.[name] = size, xxxx[s|m|h|d]\n#\n#########################################\ncaffeine.region.default = 1000, 1h \ncaffeine.region.process = 1000, 1h \ncaffeine.region.form = 1000, 1h \ncaffeine.region.bo = 1000, 1h \ncaffeine.region.boList = 1000, 1h \ncaffeine.region.signature = 1000, 120s\n\n\n#########################################\n# Lettuce scheme\n#\n# redis -> single redis server\n# rediss -> single redis server with ssl\n# redis-sentinel -> redis sentinel\n# redis-cluster -> cluster servers\n#\n#########################################\n\nredis.mode = single\n\n#redis storage mode (generic|hash)\nredis.storage = generic\n\n## redis pub/sub channel name\nredis.channel = j2cache\n## redis pub/sub server (using redis.hosts when empty)\nredis.channel.host =\n\n#cluster name just for sharded\nredis.cluster_name = j2cache\n\n## redis cache namespace optional, default[empty]\nredis.namespace =\n\n## connection\n# Separate multiple redis nodes with commas, such as 192.16\n#\n# 8.0.10:6379,192.168.0.11:6379,192.168.0.12:6379\n\nredis.hosts = localhost:6379\nredis.timeout = 2000\nredis.password = redis\nredis.database = 0\nredis.ssl = false\n\n## redis pool properties\nredis.maxTotal = 100\nredis.maxIdle = 10\nredis.maxWaitMillis = 5000\nredis.minEvictableIdleTimeMillis = 60000\nredis.minIdle = 1\nredis.numTestsPerEvictionRun = 10\nredis.lifo = false\nredis.softMinEvictableIdleTi