l\n#授权方式\nredxun.app.authorizedGrantTypes=\n#权限\nredxun.app.authorities=\nredxun.app.additionalInformation={}\n#是否自动授权\nredxun.app.autoapprove=false\n\n# 定时任务调度中心地址\njob.center=http://localhost:7878/job\n\n# 日志输出\nspring.cloud.stream.bindings.logOutput.destination=log\nspring.cloud.stream.bindings.logOutput.group= logout-group\n\n# 日志输出模式 (db 记录到数据库,logger 保存到日志文件)\nredxun.audit-log.log-type=logger\n\n# 是否允许数据源监控\ndatasource.monitor=true\n\n# tomcat 调优 \n# 等待连接数\nserver.tomcat.accept-count=1000\n# 最大连接数\nserver.tomcat.max-connections=1000\n# 最大线程数量\nserver.tomcat.max-threads=1000\n# 最小线程数\nserver.tomcat.min-spare-threads=10\n\n# 缓存机制为内存。可配置的值为 memory,j2cache\nredxun.cache=j2cache\n\n\n#zipkin-server地址\nspring.zipkin.base-url=\nspring.zipkin.discoveryClientEnabled=false\n#接口采样比例 \nspring.sleuth.sampler.probability=1\n\n#是否开启url级别权限\nredxun.security.auth.urlPermission.enable=true\n\n# 是否允许开发实例隔离\nredxun.ribbon.isolation.enabled=true\n#同步初始化密码\nredxun.initpwd=1234\n#同步组织的方式  weixin (微信) dd(钉钉)\nredxun.syncorg=weixin\n#调整Spring Cloud Feign \nfeign.compression.request.min-request-size=5120\n# API日志输出队列\nspring.cloud.stream.bindings.apiLogOut.destination= apilog\nspring.cloud.stream.bindings.apiLogOut.group= apilog-group\n\nspring.cloud.stream.bindings.errLogOut.destination= errlog\nspring.cloud.stream.bindings.errLogOut.group= errlog-group\n# 单个文件大小\nspring.servlet.multipart.max-file-size= 200MB\n# 总的请求数大小\nspring.servlet.multipart.max-request-size= 200MB\n\n#定时器开关\njob.user=true\njob.bpm=true\njob.system=false\n\n', 'c6792455abb8f24928035971a561655f', '2022-01-20 05:53:03', '2022-04-08 17:21:11', 'nacos', '192.168.1.208', '', 'local', '', '', '', 'properties', '', '');
